import  ReactDOM from "react-dom/client";
import Data from "./Data.js"
import "./style.css"


const root = ReactDOM.createRoot(document.getElementById('root'));
const Boxes = () =>
{
  const [data_array,setDataArray] = React.usxxxxweState(Data);
  const Box = (props) =>
  {
    const color = {
    backgroundColor : props.on ? "white" : "black"
    }
    return <div className="box" style={{color}}></div>
  }
  const things_array = data_array.map(function(x)
  {
    return <Box on = {x.on}/>
  })
  return things_array;
}

